import React from 'react';

function Home() {
  // Define the base64-encoded image string
  const encodedImage = `data:image/png;base64,`; // Your base64 string here




  // HTML content with the base64 encoded image
  const imageHtml = {
    __html: `<img src="${encodedImage}" alt="Embedded Image" style="display: block; margin: 0 auto; max-width: 700px; width: 80%" />`
  };

  return (
    <div>
      <br /><br /><br /><br /><br /><br />
      <figure style={{ textAlign: 'center', width: '80%', margin: '0 auto' }}>
        {/* Using dangerouslySetInnerHTML to set raw HTML */}
        <div dangerouslySetInnerHTML={imageHtml} />
      </figure>
      <br /><br />
      <h2>Test Demo of MCID 2.0</h2>
      <h4>Click <span style={{ color: '#00720a', fontSize: '1.2em' }}>Search</span> to try</h4>
      <br /><br /><br />
    </div>
  );
}

export default Home;




